    console.log("Aaa");
    const {categore} = useParams()
    const [isLoded,setIsLoded] = useState(false)
    useEffect(() => {
        axios
          .get(`https://fakestoreapi.com/products/categories`)
          .then(res => {
            
            setIsLoded(true)
          })
    
        return () => {
          setIsLoded(false)
        }
      }, [])
    return (
        <>
            <h1 className='mt-5'>{categore}</h1>
        </>
    )
}

export default Categore
